import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";

import HomeConts1 from "./fullPage/HomeConts1";
import HomeConts2 from "./fullPage/HomeConts2";
import HomeConts3 from "./fullPage/HomeConts3";
import HomeConts4 from "./fullPage/HomeConts4";
import HomeConts6 from "./fullPage/HomeConts6";

const Home = () => {
  const poterData = {
    title: "POTER - 리뉴얼",
    subtitle: "한줄 소개 : 포터 코리아 웹페이지",
    duration: "진행 기간 : 2023. 04 ~ 2023. 05",
    skills: "Skills: HTML, CSS, JS",
    imageList: [
      { image: poter1, buttonText: "깃허브", icon: githubIcon },
      { image: poter2, buttonText: "블로그", icon: blogIcon },
      { image: poter3, buttonText: "사이트", icon: siteIcon },
      { image: poter4 },
    ],
    linkList: [
      "https://github.com/kws04181/GreenComputerStudy",
      "https://oasis-lily-c04.notion.site/Porter-69d0bdf883864b31b5d98c27f6b1834d",
      "https://elegant-clafoutis-9867b1.netlify.app/",
    ],
  };
  return (
    <>
      <Fullpage>
        <div className="navi">
          <FullpageNavigation />
        </div>
        <FullPageSections>
          <HomeConts2 />
          <HomeConts1 />
          <HomeConts3 {...poterData} />
          <HomeConts4 />
          <HomeConts6 />
        </FullPageSections>
      </Fullpage>
    </>
  );
};

export default Home;
